import { Server } from "miragejs";

export function makeServer({ environment = "development" } = {}) {
  const labels = ["Tel_Aviv", "Berlin"];

  let server = new Server({
    environment,

    routes() {
      this.post(
        "/predict",
        () => ({
          prediction_id: "abc",
          class_label: labels[Math.floor(Math.random() * labels.length)],
          class_id: 4,
        }),
        { timing: 500 },
      );

      this.get("/final_score", () => ({
        ai_score: 0,
        player_score: 0,
        rounds: 1,
      }));

      this.get("/msg", () => ({
        data: "Was this Google Streetview photo taken in Germany or in Israel? Challenge yourself with an AI.",
      }));

      this.post("/score", () => ({}));

      this.post(
        "/explain",
        () => ({
          explanation_id: "abc",
          image:
            "data:image/png;base64,",
        }),
        { timing: 1000 },
      );

      this.post(
        "/streetview",
        () => ({
          image:
            "data:image/png;base64,",
          class_label: labels[Math.floor(Math.random() * labels.length)],
        }),
        { timing: 0 },
      );
    },
  });

  return server;
}
